import React, { useState, useEffect } from "react";
import axios from "axios";
import { BrowserRouter, useNavigate } from "react-router-dom";
import { LabOverview } from "../../Lab Overview/LabOverview";

export const DivWrapper = () => {
  const [labs, setLabs] = useState([]);
  const [showLabOverview, setShowLabOverview] = useState(false);
  const navigate = useNavigate();

  const handleClick = (labId) => {
    navigate(`/lab/${labId}`);
  };

  useEffect(() => {
    const fetchLabs = async () => {
      try {
        const response = await axios.get("http://localhost:8080/api/labs");
        setLabs(response.data.data);
      } catch (error) {
        console.error("Error fetching lab data", error);
      }
    };

    fetchLabs();
  }, []);

  return (
    <>
      {showLabOverview ? (
        <LabOverview />
      ) : (
        <div className="flex flex-col w-[1580px] items-start gap-5 absolute top-[441px] left-[60px]">
          {labs.length === 0 ? (
            <div>Loading labs...</div>
          ) : (
            labs.map((lab) => (
              <div
                key={lab._id}
                className="flex flex-col w-[1060px] items-start gap-4 p-8 bg-white rounded-2xl border border-[#cbcbcb] shadow-[0px_0px_15px_#0000000d]"
              >
                <div className="flex gap-[18px]">
                  <img
                    className="w-[106px] h-[106px] object-cover"
                    alt="Logo"
                    src="https://c.animaapp.com/ma15u5wlRvwvT0/img/image-4.png"
                  />
                  <div className="inline-flex items-center gap-1.5 relative flex-[0_0_auto]">
                    <div className="relative w-fit mt-[-1.04px] [font-family:'Nunito_Sans',Helvetica] font-bold text-[#202224] text-xl tracking-[-0.12px] leading-[normal]">
                      {lab.company_name}
                    </div>
                    <img
                      className="relative w-5 h-5"
                      alt="Shield trust"
                      src="https://c.animaapp.com/ma15u5wlRvwvT0/img/shield-trust-1.svg"
                    />
                  </div>
                  <div className="inline-flex items-center gap-3 relative flex-[0_0_auto]">
                    <div className="flex w-[38px] h-[38px] items-center justify-center gap-[10.42px] p-[4.17px] relative rounded-[25px] border-[1.04px] border-solid border-[#dddddd] shadow-[0px_0px_12px_#0000000d]">
                      <img
                        className="relative w-6 h-6"
                        alt="Bookmark"
                        src="https://c.animaapp.com/ma15u5wlRvwvT0/img/bookmark-1.svg"
                      />
                    </div>

                    <div className="flex w-[148px] h-[38px] items-center justify-center gap-[10.42px] p-[4.17px] relative bg-[#6161ff] rounded-[25px]">
                      <img
                        className="relative w-6 h-6"
                        alt="Akar icons link out"
                        src="https://c.animaapp.com/ma15u5wlRvwvT0/img/akar-icons-link-out.svg"
                      />

                      <div className="w-fit font-medium text-white text-sm tracking-[0] leading-[normal] relative [font-family:'Nunito_Sans',Helvetica]">
                        Visit Website
                      </div>
                    </div>
                  </div>

                </div>
                <div className="flex items-start gap-2 w-full">
                  {/* Delete */}
                  <div className="flex w-[317px] items-center justify-center gap-2 py-1 border border-[#dddddd] rounded-2xl cursor-pointer">
                    <img
                      className="w-6 h-6"
                      alt="Delete"
                      src="https://c.animaapp.com/ma15u5wlRvwvT0/img/group-3.png"
                    />
                    <div className="text-sm text-[#d50000] font-medium">
                      Delete
                    </div>
                  </div>

                  {/* View Profile */}
                  <div
                    className="flex w-[317px] items-center justify-center gap-2 py-1 border border-[#dddddd] rounded-2xl cursor-pointer"
                    onClick={() => handleClick(lab._id)}
                  >
                    <img
                      className="w-6 h-6"
                      alt="Profile"
                      src="https://c.animaapp.com/ma15u5wlRvwvT0/img/building-user--1--1.svg"
                    />
                    <div className="text-sm text-[#6161ff] font-medium">
                      View Profile
                    </div>
                  </div>

                  {/* Get Quote */}
                  <div className="flex w-[317px] items-center justify-center gap-2 py-1 border border-[#dddddd] rounded-2xl cursor-pointer">
                    <img
                      className="w-6 h-6"
                      alt="Quote"
                      src="https://c.animaapp.com/ma15u5wlRvwvT0/img/comment-1.svg"
                    />
                    <div className="text-sm text-[#6161ff] font-medium">
                      Get Quote
                    </div>
                  </div>
                </div>
              </div>
            ))
          )}
        </div>
      )}
    </>
  );
};
